def is_valid(string):
    closing = {
        '}': '{',
        ']': '[',
        ')': '('
    }
    stack = deque()

    for char in string:
        if char in closing:
            if len(stack) == 0:
                return False

            last = stack.pop()
            if last != closing[char]:
                return False
        else:
            stack.append(char)

    return True

