def get_current_block(self):
        """ Returns the start and end rows of the current block """
        anchor, _ = self.get_insert()

        # Go forward
        row = anchor
        while True:
            text = self.GetLineText(row).strip()
            if len(text) == 0:
                end = row - 1
                break
            row += 1

        # Go backwards
        row = anchor
        while True:
            text = self.GetLineText(row).strip()
            if len(text) == 0:
                start = row + 1
                break
            row -= 1            

        return (start, end)

