def _findKthNumber(self, n, k):
    """
    :type n: int
    :type k: int
    :rtype: int
    """

    def dfs(cur, n):
      if self.k == 0:
        return cur
      self.k -= 1
      if cur == 0:
        for i in range(1, 10):
          if i > n:
            break
          ret = dfs(i, n)
          if ret:
            return ret
      else:
        for i in range(0, 10):
          if cur * 10 + i > n:
            break
          ret = dfs(cur * 10 + i, n)
          if ret:
            return ret

    self.k = k
    return dfs(0, n)

